import headerdemo from "../image/headerdemo.jpg"
const Headerdemo = () =>{
    return(

        <>
        <div>
            <img style={{ justifyContent:"start" , padding:"20px"}} src={headerdemo} alt="...." width="70" height ="70" />
            <h1>own keeps</h1>

        </div>
        </>

    );
};
export default Headerdemo;
